def verticapy_logo_html(size: str = "50%") -> str:
    """
    Generates the HTML code for the VerticaPy logo.
    """
    return f'<center><img src="data:image/png;base64," style="width:{size};"></center>'


def verticapy_logo_str() -> str:
    """
    Generates the Python string that represents the
    VerticaPy logo.
    """
    img = "              ____________       ______\n"
    img += "             / __        `\\     /     /\n"
    img += "            |  \\/         /    /     /\n"
    img += "            |______      /    /     /\n"
    img += "                   |____/    /     /\n"
    img += "          _____________     /     /\n"
    img += "          \\           /    /     /\n"
    img += "           \\         /    /     /\n"
    img += "            \\_______/    /     /\n"
    img += "             ______     /     /\n"
    img += "             \\    /    /     /\n"
    img += "              \\  /    /     /\n"
    img += "               \\/    /     /\n"
    img += "                    /     /\n"
    img += "                   /     /\n"
    img += "                   \\    /\n"
    img += "                    \\  /\n"
    img += "                     \\/\n"
    return img
